import logo from './logo.svg';
import './App.css';
import Login from './Auth/login'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <StripeConfig>
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        </Routes>
    </Router>
    </StripeConfig>

  );
}

export default App;
